import React from "react";
import {
  View,
  Text,
  TextInput,
  StyleSheet,
  TouchableOpacity,
} from "react-native";

export default function SearchBar(props) {
  return (
    <View style={styles.container}>
      <TextInput style={styles.searchInp} placeholder="Search products..." />
      <TouchableOpacity style={styles.buttons}><Text>X</Text></TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flexDirection: "row",
    margin: 10,
  },
  searchInp: {
    borderWidth: 1,
    borderColor: "#ddd",
    borderRadius: 10,
    paddingHorizontal: 10,
    paddingVertical: 5,
  },
  buttons: {
    flexDirection:"row",
    padding:10,
    backgroundColor
  },
});
